import "./Aside.scss" 
import Dialogs from "./Dialogs/Dialogs";
import Message from "./Message/Message";
import { BrowserRouter} from "react-router-dom";



const Aside=(props)=>{
    let state=props.store.getState();
    return(
        <BrowserRouter>
        <div className="Aside">
        <Dialogs DialogsData={state.DialogsData}></Dialogs>
        <Message store={props.store} ></Message>
        </div>
        </BrowserRouter>
    );
}

export default Aside
